import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { Chess } from 'chess.js';
import './styles.css';

const STOCKFISH = window.STOCKFISH;

const BlunderPunisher = () => {
    // Section 1: Filter and Load Games
    const [filter, setFilter] = useState(''); // Tracks selected filter
    const [gamesLoaded, setGamesLoaded] = useState(false); // Tracks if games are loaded

    // Section 2: Summary Stats #1
    const [totalGames, setTotalGames] = useState(0);
    const [gameCounts, setGameCounts] = useState({
        hyperbullet: 0,
        bullet: 0,
        blitz: 0,
        rapid: 0,
        classical: 0,
        correspondence: 0,
    });
    const [oldestGame, setOldestGame] = useState('');
    const [newestGame, setNewestGame] = useState('');

    // Section 3: Start Button (Processing)
    const [processing, setProcessing] = useState(false);

    // Section 4: Summary Stats #2
    const [winLossRecord, setWinLossRecord] = useState('');
    const [highestRatedWin, setHighestRatedWin] = useState('');
    const [lowestRatedLoss, setLowestRatedLoss] = useState('');
    const [gameLengthData, setGameLengthData] = useState([]);

    // Section 5: Results Section
    const [filteredData, setFilteredData] = useState([]);
    const [thePgnList, setThePgnList] = useState([]);
    const [activeDropdown, setActiveDropdown] = useState(null);

    // Other states...
    const [importedGames, setImportedGames] = useState([]);
    const [commonLines, setCommonLines] = useState([]);
    const [opponentName, setOpponentName] = useState('');
    const [opponentColor, setOpponentColor] = useState('White');
    const [precisionLevel, setPrecisionLevel] = useState('Amateur/SemiPro');
    const [isLogoHovered, setIsLogoHovered] = useState(false);
    const [inputMethod, setInputMethod] = useState('chesscom'); // Default to pgn

    let stockfish = typeof STOCKFISH === "function" ? STOCKFISH() : new Worker("stockfish.js");
    stockfish.postMessage("uci");

    useEffect(() => {}, [thePgnList]);

    const handleFilterClick = (selectedFilter) => {
        setFilter(selectedFilter);
    };

    const handleLoadGames = () => {
        if (filter === 'all') {
            loadAllGames();
        } else if (filter === 'last1000') {
            loadLast1000Games();
        }
        setGamesLoaded(true);
    };

    const loadAllGames = () => {
        // Logic to load all games...
    };

    const loadLast1000Games = () => {
        // Logic to load last 1000 games...
    };

    const handleStartBlunderPunisher = () => {
        setProcessing(true);
        // Logic to start the BlunderPunisher process...
    };

    const handleLineClick = (gameIDs) => {
        const combinedPgn = createPgnFromGameIDs(gameIDs, thePgnList);
        localStorage.setItem('combinedPgn', combinedPgn);
        window.location.href = '/analysis-board';
    };

    const formatMovesWithNumbers = (line) => {
        const moves = line.Line.split("*").filter(Boolean);
        return moves.map((move, index) => {
            const moveNumber = Math.floor(index / 2) + 1;
            return index % 2 === 0 ? `${moveNumber}. ${move}` : `${moveNumber}...${move}`;
        }).join(" ");
    };

    const handleReset = () => {
        setImportedGames([]);
        setFilteredData([]);
        setGamesCount(0);
        setTotalGames(0);
        setGameCounts({
            hyperbullet: 0,
            bullet: 0,
            blitz: 0,
            rapid: 0,
            classical: 0,
            correspondence: 0,
        });
        setOldestGame('');
        setNewestGame('');
        setWinLossRecord('');
        setHighestRatedWin('');
        setLowestRatedLoss('');
        setGameLengthData([]);
        setGamesLoaded(false);
        setProcessing(false);
        // Reset other states as necessary
    };

    return (
        <div className="blunder-punisher">
            <header>
                <nav>
                    <ul>
                        <li onMouseEnter={() => setIsLogoHovered(true)}
                            onMouseLeave={() => setIsLogoHovered(false)}>
                            <Link to="/">
                                <img src={isLogoHovered ? logoWhite : logo} alt="Home" style={{ height: '40px' }} />
                            </Link>
                        </li>
                        <li><Link to="/blunder-punisher" className="prepare-link">Blunder Punisher</Link></li>
                        <li><Link to="/weakness-finder">Weakness Finder</Link></li>
                        <li><Link to="/analysis-board">Analysis Board</Link></li>
                        <li><Link to="/about-magnus">About Magnus</Link></li>
                    </ul>
                </nav>
            </header>
            <main>
                <section className="hero3">
                    <h1 className="title">Blunder Punisher</h1>

                    {/* Section 1: Filter and Load Games */}
                    <div className="filter-load-section">
                        <button 
                            className={`filter-button ${filter === 'all' ? 'selected' : ''}`}
                            onClick={() => handleFilterClick('all')}
                        >
                            All Games {filter === 'all' && <span>✔️</span>}
                        </button>
                        <button 
                            className={`filter-button ${filter === 'last1000' ? 'selected' : ''}`}
                            onClick={() => handleFilterClick('last1000')}
                        >
                            Last 1000 Games {filter === 'last1000' && <span>✔️</span>}
                        </button>
                        <button onClick={handleLoadGames}>Load Games</button>
                    </div>

                    {/* Section 2: Summary Stats #1 */}
                    {gamesLoaded && (
                        <div className="summary-stats-1">
                            <p>Total Games: {totalGames}</p>
                            <p>HyperBullet: {gameCounts.hyperbullet}</p>
                            <p>Bullet: {gameCounts.bullet}</p>
                            <p>Blitz: {gameCounts.blitz}</p>
                            <p>Rapid: {gameCounts.rapid}</p>
                            <p>Classical: {gameCounts.classical}</p>
                            <p>Correspondence: {gameCounts.correspondence}</p>
                            <p>Oldest Game: {oldestGame}</p>
                            <p>Newest Game: {newestGame}</p>
                        </div>
                    )}

                    {/* Section 3: Start Button */}
                    {gamesLoaded && (
                        <div className="start-section">
                            <button onClick={handleStartBlunderPunisher}>Start BlunderPunisher</button>
                            {processing && <p>Please wait, processing...</p>}
                        </div>
                    )}

                    {/* Section 4: Summary Stats #2 */}
                    {processing && (
                        <div className="summary-stats-2">
                            <p>Win-Loss Record: {winLossRecord}</p>
                            <p>Highest Rated Win: {highestRatedWin}</p>
                            <p>Lowest Rated Loss: {lowestRatedLoss}</p>
                            {/* Assume you have a Histogram component */}
                            <Histogram data={gameLengthData} />
                        </div>
                    )}

                    {/* Section 5: Result Section */}
                    <div className="result-section">
                        <ul>
                            {filteredData.map((line, index) => (
                                <li key={index}>
                                    <button onClick={() => handleLineClick(line.GameIDs)}>
                                        {formatMovesWithNumbers(line)}
                                    </button>
                                </li>
                            ))}
                        </ul>
                    </div>

                    {/* Reset Button */}
                    <button onClick={handleReset}>Reset</button>
                </section>
            </main>
            <footer>
                <p>&copy; 2024 SquareChess.org All rights reserved.</p>
            </footer>
        </div>
    );
};

export default BlunderPunisher;
